    "2016-10-05T09:44:29.676441",nt"name": "wilderness-breach-bathymetry-data-collected-in-june-2014-from-fire-island-new-york-25-meter-dig",nt"isopen":
    false,nt"url": null,nt"notes": "Scientists from the U.S. Geological Survey
    St. Petersburg Coastal and Marine Science Center in St. Petersburg, Florida, collected
    bathymetric data along the upper shoreface and within the wilderness breach at Fire
    Island, New York, in June 2014. The U.S. Geological Survey is involved in a post-Hurricane
    Sandy effort to map and monitor the morphologic evolution of the shoreface along
    Fire Island and model the evolution of the wilderness breach as a part of the Hurricane
    Sandy Supplemental Project GS2-2B.During this study, bathymetry was collected with
    single-beam echo sounders and global positioning systems, mounted to personal watercraft,
    along the Fire Island shoreface and within the wilderness breach. Additional bathymetry
    was collected using backpack global positioning systems along the flood shoals and
    shallow channels within the wilderness breach.",nt"license_title": null,nt"extras":
